const viewButtons = () => {
	let isMe = false;
	let isPrivate = false;
	let isFollow = false;

	if (isMe) {
		return (
			<TouchableOpacity activeOpacity={.5}>
				<Text style={[styles.txt, styles.modifyButton]}>Modifier profil</Text>
			</TouchableOpacity>
		);
	}
	if (!isFollow && isPrivate) {
		return (
			<TouchableOpacity activeOpacity={.5}>
				<Text style={[styles.txt, styles.modifyButton]}>S'abonner</Text>
			</TouchableOpacity>
		);
	}
	if (!isFollow) {
		return (
			<View style={styles.row}>
				<TouchableOpacity activeOpacity={.5}>
					<Text style={[styles.txt, styles.modifyButton]}>S'abonner</Text>
				</TouchableOpacity>
				<TouchableOpacity activeOpacity={.5}>
					<Text style={[styles.txt, styles.modifyButton]}>�crire</Text>
				</TouchableOpacity>
			</View>
		);
    }
}

export const StartScreen: React.VFC = () => {
	const navigation = useNavigation<any>();
	let nbPublications = 7;
	let nbFollowers = 83;
	let nbFollows = 86;
	let bio = 'Fume la vie avant quelle te fume - Bodelaire';
	let publications = [ProfileImage, ProfileImage, ProfileImage, ProfileImage, ProfileImage, ProfileImage, ProfileImage]

	return (
		<View style={styles.background}>
			<View style={styles.row}>
				<Text style={styles.nickname}>alexandreguichet</Text>
				<TouchableOpacity activeOpacity={.5}>
					<Icon name={'add-circle-outline'} size={30} color={'#f0f0f0'} />
				</TouchableOpacity>
			</View>
			<View style={[styles.row, styles.data]}>
				<Image source={ProfileImage} style={styles.profilePicture} />
				<View>
					<Text style={[styles.txt, {textAlign: 'center'}]}>{nbPublications}</Text>
					<Text style={[styles.txt, { textAlign: 'center' }]}>Publications</Text>
				</View>
				<View>
					<Text style={[styles.txt, { textAlign: 'center' }]}>{nbFollowers}</Text>
					<Text style={[styles.txt, { textAlign: 'center' }]}>Abonn�s</Text>
				</View>
				<View>
					<Text style={[styles.txt, { textAlign: 'center' }]}>{nbFollows}</Text>
					<Text style={[styles.txt, { textAlign: 'center' }]}>Abonnements</Text>
				</View>
			</View>
			<Text style={styles.txt}>{bio}</Text>
			{ viewButtons() }
			<View style={styles.publications}>
				<View style={styles.row}>
					<Image source={PublicationImage} style={styles.publicationPicture} />
					<Image source={PublicationImage} style={styles.publicationPicture} />
					<Image source={PublicationImage} style={styles.publicationPicture} />
				</View>
				<View style={styles.row}>
					<Image source={PublicationImage} style={styles.publicationPicture} />
					<Image source={PublicationImage} style={styles.publicationPicture} />
					<Image source={PublicationImage} style={styles.publicationPicture} />
				</View>
				<View style={styles.row}>
					<Image source={PublicationImage} style={styles.publicationPicture} />
				</View>
			</View>
		</View>
	);
}

const styles = StyleSheet.create({
	background: {
		backgroundColor: 'rgba(0, 0, 0, 1)',
		width: '100%',
		height: '100%',
		paddingTop: '10%',
	},
	nickname: {
		color: 'white',
		fontWeight: 'bold',
		fontSize: 20,
	},
	row: {
		flexDirection: 'row',
		justifyContent: 'space-between',
	},
	data: {
		marginTop: '2%',
		marginBottom: '2%',
		height: '10%',
		alignItems: 'center',
    },
	profilePicture: {
		height: '100%',
		width: '20%',
	},
	txt: {
		fontSize: 15,
		color: 'white',
	},
	modifyButton: {
		marginTop: '4%',
		borderWidth: 1,
		borderColor: 'rgba(50, 50, 50, 1)',
		borderRadius: 5,
		textAlign: 'center',
		paddingVertical: '1.5%',
	},
	publications: {
		marginTop: '4%',
	},
	publicationPicture: {
		width: '33%',
		aspectRatio: 1,
	},
});
